function callalert(title, text, type, btntext, btntype, size, bg) {


    $("#modalWindow").remove();

	var bgclean = '';
		var textcolor = "secondary";
	if(bg == 'dark')
	{
		bgclean = 'bg-dark';
		textcolor = "light";
	}
    html = '<div id="modalWindow" class="modal fade" tabindex="-1" role="dialog" aria-labelledby="confirm-modal" aria-hidden="true">';
    html += '<div class="modal-dialog modal-' + size + '">';
    html += '<div class="modal-content '+bgclean+'">';

    html += '<div class="modal-body text-center ">';
    if (type == 'success') {
        html += successanim;
    }
    if (type == 'warning') {
        html += warninganim;
    }
    if (type == 'danger') {
        html += dangeranim;
    }
    if (type == 'info') {
        html += infoanim;
    }
	

	
	
	
	
    html += '<h5 class="na-title text-' + type + '">' + title + '</h5>';
    html += '<div class="na-text text-'+textcolor+'">' + text + '</div>';

    html += '</div>';
    html += '<div class="modal-footer d-block text-center">';

    html += '<span data-dismiss="modal" class="btn px-3 btn-' + btntype + '"';
    html += ' >' + btntext;
    html += '</span>';


    html += '</div>';  // footer
    html += '</div>';  // content
    html += '</div>';  // dialog
    html += '</div>';  // modalWindow
    $('body').append(html);
    $("#modalWindow").modal();
    $("#modalWindow").modal('show');


}



	
